        <div class="empty-text">{{ activeTab === 'following' ? '暂未关注其他用户' : '暂无粉丝' }}</div>
      </div>
      
      <div v-else>
        <div v-for="user in users" :key="user.userId" class="mb-2">
          <UserCard :user="user" @follow="handleFollowUser" :type="listType" />
        </div>
        
        <!-- 加载更多 -->
        <div v-if="hasMore" class="text-center py-4">
          <button 
            @click="loadMore" 
            class="text-gray-500 hover:text-gray-700"
            :disabled="loadingMore"
          >
            {{ loadingMore ? '加载中...' : '加载更多' }}
          </button>
        </div>
        
                  <!-- 底线提示 -->
                  <div v-if="users.length > 0" class="bottom-line">
                    <div class="line"></div>
                    <div class="text">小哈是有底线的</div>
                    <div class="line"></div>
                  </div>
      </div>
    </div>
  </div>
</template>

<script setup>
import { ref, onMounted, watch, onUnmounted } from 'vue'
import { useRoute } from 'vue-router'
import UserCard from '@/components/user/UserCard.vue'
import { getFollowingList, getFansList, followUser } from '@/api/relation'
import { message } from '@/utils/message'
import LoadingSpinner from '@/components/common/LoadingSpinner.vue'

const route = useRoute()
const userId = ref(route.params.userId)
const nickname = ref('')
const activeTab = ref(route.query.tab || 'following')
const users = ref([])
const loading = ref(true)
const loadingMore = ref(false)
const hasMore = ref(true)
const pageNo = ref(1)
const pageSize = 20
const listType = ref('following')

const loadingRef = ref(null)

// 获取关注列表
const fetchFollowingList = async (isLoadMore = false) => {
  if (isLoading.value) return
  
  if (isLoadMore) {
    loadingMore.value = true
  } else {
    loading.value = true
    // loadingRef.value?.show()
    users.value = []
    pageNo.value = 1
  }
  
  try {
    const res = await getFollowingList(userId.value, pageNo.value, pageSize)
    if (res.success) {
      const newUsers = res.data || []
      
      // 处理数据，添加 isLiked 字段
      const processedUsers = newUsers.map(user => ({
        ...user,
        isLiked: true // 关注列表中的用户默认都是已关注的
      }))
      
      if (isLoadMore) {
        users.value = [...users.value, ...processedUsers]
      } else {
        users.value = processedUsers
      }
      
      hasMore.value = newUsers.length === pageSize
      pageNo.value++
    }
  } catch (error) {
    console.error('获取关注列表失败', error)
  } finally {
    loading.value = false
    loadingMore.value = false
    // loadingRef.value?.hide()
  }
}

// 获取粉丝列表
const fetchFollowersList = async (isLoadMore = false) => {
  if (isLoading.value) return
  
  if (isLoadMore) {
    loadingMore.value = true
  } else {
    loading.value = true
    // loadingRef.value?.show()
    users.value = []
    pageNo.value = 1
  }
  
  try {
    const res = await getFansList(userId.value, pageNo.value, pageSize)
    if (res.success) {
      const newUsers = res.data || []
      
      // 处理数据，添加 isLiked 字段（粉丝可能已关注也可能未关注）
      const processedUsers = newUsers.map(user => ({
        ...user,
        isLiked: user.isLiked || false
      }))
      
      if (isLoadMore) {
        users.value = [...users.value, ...processedUsers]
      } else {
        users.value = processedUsers
      }
      
      hasMore.value = newUsers.length === pageSize
      pageNo.value++
    }
  } catch (error) {
    console.error('获取粉丝列表失败', error)
  } finally {
    loading.value = false
    loadingMore.value = false
    // loadingRef.value?.hide()
  }
}

// 加载更多
const loadMore = () => {
  if (activeTab.value === 'following') {
    fetchFollowingList(true)
  } else {
    fetchFollowersList(true)
  }
}

// 处理关注/取消关注
const handleFollowUser = (followUserId) => {
  followUser(followUserId).then(res => {
    if (!res.success) {
      message.show(res.message)
      return
    }
    
    // 更新用户关注状态
    const userIndex = users.value.findIndex(user => user.userId === followUserId)
    if (userIndex !== -1) {
      users.value[userIndex].isLiked = !users.value[userIndex].isLiked
    }
    
    message.show(users.value[userIndex].isLiked ? '关注成功' : '取消关注成功')
  })
}

// 添加滚动加载功能
const isLoading = ref(false)

// 处理滚动事件
const handleScroll = () => {
  if (loading.value || loadingMore.value || !hasMore.value) return
  
  const scrollTop = window.pageYOffset || document.documentElement.scrollTop
  const windowHeight = window.innerHeight
  const documentHeight = document.documentElement.scrollHeight
  
  // 当滚动到距离底部一定距离时加载更多
  if (documentHeight - scrollTop - windowHeight < 200) {
    loadMore()
  }
}

// 监听标签变化
watch(activeTab, (newTab) => {
  if (newTab === 'following') {
    listType.value = 'following'
    fetchFollowingList()
  } else {
    listType.value = 'fans'
    fetchFollowersList()
  }
})

onMounted(() => {
  // 添加滚动事件监听
  window.addEventListener('scroll', handleScroll)
  
  if (activeTab.value === 'following') {
    fetchFollowingList()
  } else {
    fetchFollowersList()
  }
})

onUnmounted(() => {
  // 移除滚动事件监听
  window.removeEventListener('scroll', handleScroll)
})
</script>

